Зимняя резина в ПОДАРОК!
Работаем ежедневно , без праздников и выходных : 9:00 - 20:00!

 Вся история автомобиля юридически чиста и подтверждена соответствующими документами. В ходе проведенной диагностики дефектов не выявлено. Пробег оригинальный! Лакокрасочное покрытие в норме. Полный комплект ключей! Второй комплект резины на оригинальных литых дисках в подарок! 

Предлагаем обмен и выкуп по специальным ценам в Trade In Центре Автолидер Варшавка. Воспользуйтесь уникальной возможностью продать свой автомобиль с максимальной выгодой в 50 000 рублей! Звоните прямо сейчас!

Автомобиль находится в отличном состоянии. ПТС оригинал! Все ТО строго по регламенту завода производителя! Сервисная книжка со всеми отметками о ТО в наличие и подтверждает пробег! На автомобиле произведена предпродажная подготовка с заменой всех масел и фильтров так же произведена диагностика КПП и ходовой, в результате которой отклонений не выявлено. Лакокрасочное покрытие в норме. Полный комплект ключей! Второй комплект резины на оригинальных литых дисках в подарок! Автомобиль полностью готов к дальнейшей эксплуатации!

Продаётся надежный автомобиль Инфинити g25. По факту я третий владелец  (физ.лицо), первый владелец юр.лицо, второй и третий родственник ( который трижды менял номера ). Машина с реальным пробегом до 65000 обслуживалась у официального дилера (Инфинити Таганка), все заказ наряды в наличии, после чего так же было должное обслуживание, есть все заказ-наряды. Я приобрёл машину с пробегом 105 000. На пробеге 115 000 было установлено ГБО евро-4 (digitronic AEB) баллон на 50 литров. ( все документы в наличии). Расход на газу - 14 литров город, 10 литров трасса - очень экономично.  На 120 000 было пройдено большое ТО, замена масла АКПП, замена тормозных суппортов и дисков от старших собратьев (fx 37), перебрана вся подвеска, масло лью AMSOIL-5w30. Помимо прочего было выполнено предыдущим хозяином:
- лампы HPL - динамические поворотники и ДХО с плавным притуханием и в передних, и в задних фарах;
- доп. радиатор АКПП;
- охранная система с меткой, пин-кодом и обратной связью Призрак;
- проставки на колеса для правильного вылета если что, снимаются за 5 мин;
- устранена раз и навсегда течь масла в свечных колодцах - болячка этих моторов
- заменена клапанная крышка и сразу промазано герметиком;
- замена клапана РVС;
- разблокировано DVD в движении, можно в пробках смотреть фильмы;
- атермальная пленка на передние боковые и лобовое (оригинал);
- ручки управления магнитолой и климатом из алюминия;
- руль перешит в нормальную кожу;
- установлены усиленные стабы поперчной устойчивости, и перед, и зад от G37 купе (гораздо лучше рулится);
- пружины также от G37 полноприводной - подвеска более упругая и адекватная;
- прошита коробка у Димы Ёжика, кто знает, тот поймет. Работает спорт режим и можно переключаться по 4 картам настроек коробки;
- чипа на движок нет; как итог — коробка меньше дергается, нет пинков от переключения поворотника, как у многих фиников;
- масло заливается исключительно AMSOIL Signature 5W30, и раз в 6-8 тыс;
- панели салона обтянуты пленкой под шлифованный алюминий; 
- ручка КПП обтянута нормальной кожей;
- кожа сидений постоянно обрабатывалась спец. химией, нет залома валика сиденья водителя.

Уникальный автомобиль для понимающих людей:
транспортный налог 12000 руб/год (против стандартных 42000 руб);
Без штрафов с камер/парковок (сам не нарушаю, но все же), даже за 2 месяца в случае остановки инспектором;
номера 777 ** 99;
управлять может любой человек с действующим ВУ;

Фактическая цена 790 тысяч рублей. В продаже с 10 октября 2020 года, хотя объявление датировано 2019 годом - изучал спрос. Подробная информация ниже в описании (нажмите "Показать полностью").

Пожалуйста, читайте описание полностью и не звоните с вопросами "почему так дорого?". Цена в 990 тысяч рублей указана с учетом доведения автомобиля до идеального состояния - ведь все же мы хотим б/у автомобиль который выглядит и едет как новый :) А тут вы сразу знаете цену в которую вам это выйдет. Предоставляю скидку в размере 200 000 руб для устранения всех недочетов автомобиля по кузову, полировки, химчистки салона, покраски дисков и тд и тп (все же автомобилю 12 лет). Не против любых проверок. Сейчас пробег в районе 124 тысяч. 

Я второй владелец, покупал у официального дилера Infiniti АвтоСпецЦентр на Ленинском проспекте в Москве в июне 2013 года с подтвержденным пробегом 35 000 км. Ограничений по рег.действиям нет, юридически чистая, в ПТС занесена запись о продаже дилером. После покупки на учет в РФ не ставил, ездил по Москве на транзитах. В Сентябре 2019 года съездил в Армению, зарегистрировал юридическое лицо и поставил автомобиль на учет в Армении на это самое юридическое лицо.

Автомобиль был ввезен в Россию и растаможен производителем на Центральной Акцизной Таможне в конце 2008 года. Без претензий с стороны ГИБДД по 12.1 (так как собственник юридическое лицо) и 12.3 (так как растаможен в РФ) - не путайте с автомобилями, растаможенными по льготным ставкам в Армении, это совсем другой случай! Кроме того, в любой момент вы можете снять данный автомобиль с учета в Армении и поставить обратно на учет в РФ без всяких кнопок ГЛОНАСС и тп. ПТС лежит в архиве ГАИ в г. Москва (на руках есть копия, в том числе нотариально заверенная). ОСАГО 12000 руб в год без ограничений.

Двигатель, коробка и остальное - работают как часы. Подвеска идеал. Сам не курю и другим курить в салоне не разрешаю. Имеется вся история обслуживания за весь период с момента покупки первым собственником в 2009 году по текущее время (заказ-наряды, чеки, выписки по купленным запчастям и тп). По кузову есть притертости, царапины, пару вмятин, но без серьезного криминала - как уже писал выше, предоставлю скидку на устранение. Масло и фильтры меняю каждые 7500км, лью оригинальный Мотюль, от замены до замены щуп на середине (не ест масло). Два комплекта живой (два сезона, езжу мало) летней и зимней резины - Toyo Proxes T1R 245/45 и KUMHO I'Zen KW27 245/50 липучка. Обслуживался в клубном сервисе I-Gear и у официального дилера, несколько тысяч км назад поменял все четыре ступицы в круг и заменил крестовину кардана (стандартные для этой модели болячка к 120 тысячам пробега, больше болячек у этой модели нету). Ближайшие пятьдесят тысяч можно спокойно ездить, меняя только расходники. Из доработок стоит стальная защита двигателя и коробки, противоугонки, светодиодиодные ПТФ (отлично светят и выглядят, родные отдам в подарок), а так же заменены форсунки омывателя лобового на веерные от M37 (стоковые форсунки ужасны). По рулевой рейке - работает исправно, не течет, можно спокойно ездить, но немного тугая и микролюфт. Замена на новую оригинальную обойдется в 60-70 тысяч рублей с учетом работы, опять же из-за этого и предоставляю скидку.

Очень люблю эту машину, но вынужден неспешно продавать в связи с расширением семейства - нужен  внедорожник. Динамики хватает "за глаза", полный привод зимой просто сказка. Настоящий Японец с настоящим "доипотечнокризисным" японским качеством, сейчас так уже не делают. Соотношение цена/качество зашкаливает. Единственный оставшийся недостаток данной модели - достаточно прожорливая (12л по трассе и 16-18л по городу). Решается установкой ГБО - двигатель VQ35DE отлично переводится на газ, без снижения ресурса и динамики (на Drive2 есть много историй). Супер комфортная и надежная машина, а с ГБО еще и супер экономичная. Продается путем продажи юр лица - юр лицо нулевое, деятельности не ведет. Бух услуги за нулевую отчетность 100$ в год, оформляется дистанционно. Возить переоформлять автомобиль никуда не надо - сел и поехал, достаточно оформить продажу ООО у нотариуса. Отвечу на все вопросы по телефону.

Все автомобили, представленные в продаже, проходят тщательную проверку по более 40 параметрам. Предоставляем гарантию юридической чистоты, а так же год технической гарантии на двигатель и КПП. Бесплатный тест-драйв. Возможно оформление автомобиля в кредит!

Преимущества автокредитования:
— Первоначальный взнос от 0%;
— Более 30 кредитных программ;
— Процентная ставка от 6% годовых;
— Срок кредита от 6 месяцев до 7 лет;
— Оформление кредита по двум документам;
— Досрочное погашение без штрафов и комиссий;
— Сумма кредита до 2 млн рублей;
— Оформление КАСКО – по желанию;
— Без справок и поручителей.

Сотрудничаем с 12 аккредитованными и сертифицированными банками РФ, среднее время ожидания решения банка 20–30 минут.

При покупке автомобиля по программе «Trade-in – выгодный обмен» или в кредит, получите дополнительную скидку до 80 000 рублей на данный автомобиль!

Записаться на тест-драйв, а так же получить подробную информацию можно у специалистов автоцентра по указанному номеру телефона.
